window.bookSummaryJSON = "<p>After surviving a harsh winter, Eli finds himself in a unique situation when a long-lost dungeon is discovered on the property. It could be the perfect proving ground for the students who have earned their Class, but it could also become their tomb.</p> <p>It also doesn't help that the town of Last Stop is in danger. The Edgelands are creeping in and gobbling up entire cities overnight. With nowhere else to take the children, it's up to Eli to come up with a solution to both problems that only a Master Enchanter could accomplish. With the love of a few good women by his side, anything is possible.</p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
